import logo from './logo.svg';
import './App.css';
import { threads, messages, users } from "./data/feedData";
import Thread from './components/thread';

function Feed() {
  return (
    <div className="App">
      <Thread threads={threads} messages={messages} users={users}/>
    </div>
  );
}

export default Feed;
